import React from 'react';
import './nav.css';
import { Link } from 'react-router-dom';
import SchoolIcon from '@mui/icons-material/School';


function Adminnav(){
  return (
    <div className="sidenav">
      <table>
            <tr><a></a></tr>
            <tr><Link style={{padding:"0"}} to="/giveapproval"><a style={{display:"flex"}}><div style={{marginRight:"20px"}}></div>Give Approval</a></Link></tr>
            <tr><Link style={{padding:"0"}} to="/providesolution"><a style={{display:"flex"}}><div style={{marginRight:"20px"}}></div>Provide Solution</a></Link></tr>
            <tr><Link style={{padding:"0"}} to="/department"><a style={{display:"flex"}}><div style={{marginRight:"20px"}}></div>Department</a></Link></tr>

    
      </table>
  </div>
  )
}

export default Adminnav;
